var keys = ["",
            "",
            "",
            "",
            ""];

var code = "";

var x = 5;
for (i=0; i<keys.length; i++){
  for (j=0; j<keys[i].length; j++){
    switch (keys[i].charAt(j)){
      case "U":
        if (x!=1 && x!=2 && x!=3){
          x-=3;
        }
        break;
      case "D":
        if (x!=7 && x!=8 && x!=9){
          x+=3;
        }
        break;
      case "L":
        if (x!=1 && x!=4 && x!=7){
          x-=1;
        }
        break;
      case "R":
        if (x!=3 && x!=6 && x!=9){
          x+=1;
        }
        break;
    }
  }
  code = code + x.toString();
}
console.log(code);
